NO CONTEST plea entered to count 1, possess Morphine.  Convicted.
The State moves to dismiss count 2.  Motion granted.
Sentence is withheld and the defendant is placed on probation to DOC for eighteen (18) months.
Conditions of probation:
1) submit to random urine screens and pay for same;
2) no contact with any known drug dealers or users;
3) maintain fulltime employment, school or combination which equals fulltime work;
4) twenty (20) hours of community service;
5) continue current treatment program with Fond Du Lac Psychiatry and Opiate Management;
6) assessment, treatment counseling as deemed appropriate by the Department's assessment process;
7) pay court costs;
8) pay supervision fees in an amount to be determined by DOC.
Plea Questionnaire and Waiver of Rights.
Minutes.
